        that.activeDate = (starts[0] == nowYear ? "" : starts[0] + "年") + starts[1] + "月" + starts[2] + "日" + "~" + (ends[0] == nowYear ? "" : ends[0] + "年") + ends[1] + "月" + ends[2] + "日";
